subchanges.actualSource:
static Object compactNumber(Object o) {
  if (o instanceof Long) {
    Long l = (Long) o;
    if (l >= Integer.MIN_VALUE && l <= Integer.MAX_VALUE) {
      return l.intValue();
    }
  }
  return o;
}

