33714d9ad66622f545a030a7d3df94f4b0e73794.actualSource:
private static Object maybeConvert(Object o) {
  if (o instanceof Long) {
    Long l = (Long)o;
    if (l >= Integer.MIN_VALUE && l <= Integer.MAX_VALUE) {
      return l.intValue();
    }
  }
  return o;
}
